eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('VueRemarkRoot',[_c('RoboAcademyText',{attrs:{\"fWeight\":\"500\"}},[_vm._v(\"\\n  Inleiding: \\\"Het verhaal van een meisje genaamd Trinity\\\"\\n\")]),_c('p',[_vm._v(\"De mythologie van het oude Griekenland is verdeeld in twee grote cycli: de periode waarin de Olympische Goden de wereld van de mensen regeerden, en een latere periode waarin het levenspad van helden wordt bepaald door het lot, bijvoorbeeld Troje of de legende van Oedipus. In mijn leven verliep aanvankelijk alles volgens het tweede scenario - mijn vader noemde me Trinity bij mijn geboorte, en op mijn 20e volgde ik een soort wit konijn.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Olympus_Troy_The_Tales_of_Oedipus.png\",\"alt\":\"Olympus Troy The Tales of Oedipus\"}}),_c('p',[_vm._v(\"Het konijnenhol bracht me terug naar Megapolis, maar vanuit het perspectief van de data-informatiebus. Daar, in de ondergrondse datacenters, vond ik bewijs van het bestaan van Goden, vergelijkbaar met de Griekse Goden in hun zelfingenomenheid, grillen en verlangens!\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Gods-datacenter.png\",\"alt\":\"Gods datacenter\"}}),_c('p',[_vm._v(\"Enkele jaren geleden vond ik een volledig vergeten kwetsbaar toegangspunt tot de hoofdweg van de stad. Ik had een deur naar een vreemde wereld van transparante, leesbare en bewerkbare programmacode voor het basiscommunicatieprotocol van de hele Megastad. Programmacode die me leidde tot het onderscheppen van camera's, het controleren van deursloten zonder medeweten van de eigenaars, en zelfs het verdoemen van dynamisch waterkwaliteitsbeheer in individuele huishoudens' keukenkranen. Na dit alles gezien te hebben, werd ik vervuld van een vreselijke angst. Angst dat dit allemaal opzettelijk gebeurde vanuit het oogpunt van iemands belangen in deze wereld. Ik kan niet zeggen dat er één grote kwaadaardige silhouet achter al deze veranderingen in de protocolcode zit, maar na jaren van observatie van achter de schermen ben ik tot de conclusie gekomen dat honderden mensen met verschillende belangen directe toegang hebben tot de kern. Hoe hard ik ook probeerde om ten minste één van deze bevoorrechte gebruikers te vinden, ik bleef alleen achter met onderschepte cryptografische bewijzen van uitvoering, maar geen verzender sleutel, geen sporen die me naar de waarheid konden leiden.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/hacking.png\",\"alt\":\"Gods hackers stayed in circle\"}}),_c('p',[_vm._v(\"Nu ben ik een netrunner die gespecialiseerd is in het bieden van cyberbeveiliging en privacy in de persoonlijke ruimte van een klant. Ik ben een specialist die zal helpen externe controle van uw huis, kantoor of auto te vermijden, zelfs als het signaal afkomstig is van de autonome kern van de Megapolis.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Trinnity.png\",\"alt\":\"Trinity in underground datacenter\"}}),_c('p',[_vm._v(\"Om mijn hulp in te roepen, moet u een contract publiceren op Satoshi Square, vervolgens digitaal goud overmaken naar het contractadres. Daarna zal ik of een van de geverifieerde professionals de handeling uitvoeren om de digitale kopie van de cloud van het echte object in de fysieke wereld af te snijden. Onderling noemen we deze handeling van wedergeboorte met het doorsnijden van de navelstreng. Nu bent u een belangrijk persoon! U hoeft zich geen zorgen te maken dat iemand uw start-up zal breken door een opname vanuit de slaapkamer waar u masturbeert naar een foto van uw zus terwijl u een leren masker draagt. U kunt rustig politiek bespreken met een vriend uit Californië, terwijl u een congreslid uit Texas bent. U kunt met uw kinderen over deze wereld praten zonder een tekstboek en niet bang zijn dat uw ouderlijke rechten zullen worden beslist.\")]),_c('p',[_vm._v(\"Herinner je je toen ik je vertelde dat ik overweldigd was door angst nadat ik alles had gerealiseerd? Ik dacht dat de rest van mijn leven een poppentheater van iemand anders was. Maar werken als netrunner heeft me gered van diepe depressie, hoewel ik nooit de waarheid over deze vreemde aardse goden heb onthuld. In plaats van depressie besloot ik te verheugen wanneer ik iemand invloedrijk, rijk of gewoon bezorgd over hun privacy kan helpen om onvrijwillige betrokkenheid bij een ander seizoen van het drama van CyberDionysus te vermijden.\")])],1)}\nvar staticRenderFns = []\n\n\n\n//# sourceURL=webpack:///./courses/nl/learn/escape-from-black-mirror/overview.md?./node_modules/cache-loader/dist/cjs.js?%7B%22cacheDirectory%22:%22node_modules/.cache/gridsome%22,%22cacheIdentifier%22:%223ec475f9-vue-loader-template%22%7D!./node_modules/gridsome/node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/gridsome/node_modules/vue-loader/lib??ref--17-0!./node_modules/@gridsome/vue-remark/lib/loader.js??ref--17-1");

